<?php $__env->startSection('content'); ?><p>Arabella Del Busso sent fans into a spin when it was reported that she was being considered to appear on Channel Seven's military-style series SAS Australia.</p>

<p>But now Daily Mail Australia can reveal the 31-year-old controversial NRL WAG won't be appearing on its upcoming reality show.</p>

<p>A spokesman for the network confirmed filming has wrapped.</p>

<p>EXCLUSIVE: Notorious ex-WAG Arabella Del Busso (pictured) will NOT be joining Seven's upcoming reality series, SAS Australia - as it's revealed the show has already been filmed</p>

<p>Photos from the set of the series taken during filming last month show no signs of Arabella. </p>

<p>'Nothing has been confirmed yet,' the brunette bombshell said when she was approached for comment.</p>

<p>Angry rugby league fans vented their frustration on Twitter after it was revealed on Sunday that Arabella could possibly join the cast. </p>

<p>Not this time! Daily Mail Australia can reveal the model won't be appearing on this year's season of the upcoming reality show</p>

<p>'I'll never watch Channel Seven putting a loser like that on shows how much credibility they have,' one fan tweeted.</p>

<p>'I, for one, will not be tuning in... Absolutely disgusted in your efforts for ratings,' another added.</p>

<p>'It's very controversial at the moment, but hey haters will hate,' Arabella said in response to the backlash.</p>

<p>Not happy: Angry rugby league fans vented their frustration on Twitter after it was revealed on Sunday that Arabella was tipped to be joining the cast</p>

<p>On Sunday, News Corp reported the lingerie model was among the growing list of celebrities including convicted drug smuggler Schapelle Corby and publicist Roxy Jacenko.</p>

<p>The military-style program will see the contestants having to endure sleep deprivation, interrogation techniques and physical challenges.</p>

<p>To date, Candice Warner, Merrick Watts and Nick Cummins are the only celebrities to confirmed to be joining previously announced Roxy and Schapelle.</p>

<p>SAS Australia premieres this October on Channel Seven. </p>

<p>Soon to air: SAS Australia will air in October on Seven. Pictured: Schapelle Corby</p>
